angular.module('MyApp', ['ngRoute', 'ngAnimate', 'ngProgress', 'ngDisqus', 'ngTable'])
  .config(['$routeProvider', '$locationProvider', '$disqusProvider', function($routeProvider, $locationProvider, $disqusProvider) {
    $disqusProvider.setShortname('jsrecipes');
    $locationProvider.hashPrefix('!');

    $routeProvider
      .when('/', {
        templateUrl: 'views/main.html',
        controller: 'MainCtrl'
      })
      .when('/backend/:name', {
        templateUrl: 'views/detail.html',
        controller: 'MainCtrl'
      })
      .when('/frontend/:name', {
        templateUrl: 'views/detail.html',
        controller: 'MainCtrl'
      })
      .when('/general/:name', {
        templateUrl: 'views/detail.html',
        controller: 'MainCtrl'
      })
      .when('/feedback', {
        templateUrl: 'views/feedback.html',
        controller: 'MainCtrl',
        title: 'Feedback'
      })
      .when('/contribute', {
        templateUrl: 'views/contribute.html',
        controller: 'MainCtrl',
        title: 'Contribute'
      })
      .otherwise({
        templateUrl: 'views/404.html',
        controller: 'MainCtrl',
        title: 'Not Found'
      });
  }]);

angular.module('MyApp')
  .controller('MainCtrl', ['$scope', '$rootScope', '$route', '$window', 'Posts', 'GitHub', '$routeParams', 'ngProgress' ,function($scope, $rootScope, $route, $window, Posts, GitHub, $routeParams, ngProgress) {
    $scope.$on('$routeChangeSuccess', function($currentRoute, $previousRoute) {
      if ($routeParams.name) {
        ngProgress.start();
        Posts.getBySlug($routeParams.name, function(post) {
          $scope.post = post;
          ngProgress.complete();
          $window.document.title = $scope.post.title + " - " + 'JS Recipes'

          // Get last commit date
          GitHub.lastCommit(post.file, function(data, status, headers, config) {
            if (status === 0) return $scope.lastUpdated = 'Unknown';
            $scope.lastUpdated = new Date(data[0].commit.committer.date).toLocaleString();
          });
        });
      } else {
        $rootScope.title = $route.current.title;

        Posts.getPosts(function(posts) {
          $scope.posts = posts;
        });

        GitHub.getContributors(function(contributors) {
          $scope.contributors = contributors.slice(0,10);
        });
      }
    });
  }]);

angular.module('MyApp')
  .directive('markdown', ['$http', '$compile', function($http, $compile) {
    var converter = new Showdown.converter();
    return {
      link: function(scope, element, attrs) {
        attrs.$observe('file', function(file) {
          if (file) {
            $http.get('posts/' + file).success(function(response) {
              var htmlText = converter.makeHtml(response);
              element.html(htmlText);
              $compile(element.contents())(scope);
              $('pre code').each(function(i, e) {
                hljs.highlightBlock(e);
              });
            });
          }
        });
      }
    }
  }]);
angular.module('MyApp')
  .directive('scroll', ['$window', function($window) {
    return function(scope, element, attrs) {
      angular.element($window).bind('scroll', function() {
        if (this.pageYOffset >= 150) {
          $('.edit-on-github').fadeIn(200);
        } else {
          $('.edit-on-github').fadeOut(200);
        }
      });
    }
  }]);
angular.module('MyApp')
  .factory('GitHub', ['$http', function($http) {
    return {
      lastCommit: function(file, callback) {
        $http.get('https://api.github.com/repositories/17648824/commits?path=posts/' + file)
          .success(callback)
          .error(callback)
      },
      getContributors: function(callback) {
        $http.get('https://api.github.com/repos/sahat/jsrecipes/contributors')
          .success(callback)
          .error(callback)
      }
    }
  }]);

angular.module('MyApp')
  .factory('Posts', ['$http', function($http) {
    return {
      getPosts: function(callback) {
        $http.get('posts/posts.json').success(callback);
      },
      getBySlug: function(slug, callback) {
        this.getPosts(function(data) {

          var recursiveGetProperty = function(obj, lookup, callback) {
            for (var property in obj) {
              if (property == lookup) {
                callback(obj);
              } else if (obj[property] instanceof Object) {
                recursiveGetProperty(obj[property], lookup, callback);
              }
            }
          };

          recursiveGetProperty(data, 'slug', function(obj) {
            if (obj.slug === slug) {
              callback(obj);
            }
          });
        })
      }
    }
  }]);
